	fern "github.com/mixed-file-directory/fern"
	fernclient "github.com/mixed-file-directory/fern/client"
	option "github.com/mixed-file-directory/fern/option"
	webhooks "github.com/mixed-file-directory/fern/webhooks"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Webhooks.Subscriptions.UpdateSignatureKey(
	context.TODO(),
	"subscription_id",
	&webhooks.UpdateWebhookSubscriptionSignatureKeyRequest{
		IdempotencyKey: fern.String(
			"ed80ae6b-0654-473b-bbab-a39aee89a60d",
		),
	},
)

